import React from 'react';

const user = JSON.parse(localStorage.getItem('user'));
const today = new Date();
const days = ['Pazar', 'Pazartesi', 'SalÄ±', 'Ã‡arÅŸamba', 'PerÅŸembe', 'Cuma', 'Cumartesi'];
const months = ['Ocak', 'Åžubat', 'Mart', 'Nisan', 'MayÄ±s', 'Haziran', 'Temmuz', 'AÄŸustos', 'EylÃ¼l', 'Ekim', 'KasÄ±m', 'AralÄ±k'];

export default function Dashboard() {
  return (
    <div className="min-h-screen flex bg-gradient-to-br from-blue-400 via-indigo-400 to-purple-400 text-[#2d2350] font-sans transition-colors duration-700 relative overflow-hidden">
      {/* Animated Blobs */}
      <AnimatedBlobs />
      {/* Sidebar */}
      <aside className="w-24 flex flex-col items-center py-10 bg-white/10 text-white space-y-6">
        <div className="text-2xl font-bold mb-6">ðŸ’™</div>
        <SidebarIcon icon="ðŸ " />
        <SidebarIcon icon="ðŸŽ­" />
        <SidebarIcon icon="ðŸ“Š" />
        <SidebarIcon icon="ðŸ’–" />
        <SidebarIcon icon="âš™ï¸" />
      </aside>

      {/* Main */}
      <main className="flex-1 flex flex-col justify-center items-center px-4 py-10 z-10 text-white">
        <div className="flex justify-between w-full max-w-4xl items-center mb-10">
          <h1 className="text-4xl font-bold">HoÅŸ Geldiniz!</h1>
          <div className="bg-white/30 px-4 py-2 rounded-full text-sm">
            {today.getDate()} {months[today.getMonth()]} {days[today.getDay()]}
          </div>
        </div>

        <p className="text-lg mb-6">BugÃ¼n nasÄ±l hissediyorsunuz?</p>

        <div className="w-full max-w-xl bg-white/90 rounded-2xl shadow-2xl p-6 mb-6">
          <div className="flex gap-2">
            <input
              type="text"
              placeholder="DuygularÄ±nÄ±zÄ± buraya yazÄ±n..."
              className="w-full px-4 py-3 rounded-l-lg bg-white text-gray-800 placeholder-gray-400 focus:outline-none"
            />
            <button className="bg-indigo-500 px-4 py-3 rounded-r-lg text-white font-semibold">Metin</button>
          </div>
          <button className="mt-4 w-full bg-indigo-600 hover:bg-indigo-700 text-white py-3 rounded-lg font-semibold text-lg transition">
            Analiz Et
          </button>
        </div>
      </main>
    </div>
  );
}

function SidebarIcon({ icon }) {
  return (
    <div className="w-12 h-12 flex items-center justify-center bg-white/20 hover:bg-white/40 rounded-lg text-xl cursor-pointer transition">
      {icon}
    </div>
  );
}

function AnimatedBlobs() {
  return (
    <>
      <svg className="absolute top-[-120px] left-[-120px] w-[400px] h-[400px] opacity-30 z-0 animate-blob-move" viewBox="0 0 400 400" fill="none">
        <ellipse cx="200" cy="200" rx="200" ry="200" fill="#60a5fa" />
      </svg>
      <svg className="absolute bottom-[-100px] right-[-100px] w-[300px] h-[300px] opacity-20 z-0 animate-blob-move2" viewBox="0 0 400 400" fill="none">
        <ellipse cx="200" cy="200" rx="200" ry="200" fill="#9333ea" />
      </svg>
      <style>{`
        .animate-blob-move {
          animation: blobMove 12s ease-in-out infinite alternate;
        }
        .animate-blob-move2 {
          animation: blobMove2 14s ease-in-out infinite alternate;
        }
        @keyframes blobMove {
          0% { transform: scale(1) translate(0,0); }
          50% { transform: scale(1.1) translate(40px, 30px); }
          100% { transform: scale(1) translate(0,0); }
        }
        @keyframes blobMove2 {
          0% { transform: scale(1) translate(0,0); }
          50% { transform: scale(1.15) translate(-30px, -20px); }
          100% { transform: scale(1) translate(0,0); }
        }
      `}</style>
    </>
  );
}
